import React from 'react';

function Proj(){

    const projetos = [
        {
            title: 'puppet',
            description: 'blablabla',
            link: 'not yet'

        },
        {
            title: 'puppet',
            description: 'blablabla',
            link: 'not yet'

        },
        {
            title: 'puppet',
            description: 'blablabla',
            link: 'not yet'

        }
    ]

    return(
        <div>
        {projetos.map(projetos =>
        <div>
            <h1>{projetos.title} ({projetos.title})</h1>
            <p>Weapon of choice: {projetos.title}</p>
            <hr/>
        </div>
        )}
    </div>
    );
}

export default Proj
